import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Item from './Item.js';


class List extends Component {

    static defaultProps = {
        content: "",
        itemArr: []
    }

    render() {
        var listEntries = this.props.entries;

        function generateLine(item) {
            return <div id="DV_Thing"><button key={item.key}>{item.text}</button></div>
        }

        // var listItems = listEntries.map(generateLine);
        var listItems = listEntries.map((item) => {
            generateLine(item);
        })

        return (
            <div id="ToDoList">
                {listItems}
            </div>
        )
    }
}

export default List;
